import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Attempt XSS via Search Input
    const xssPayload = '<script>alert("XSS")</script>';
    await page.fill('#searchInput', xssPayload);
    await page.click('.search-btn');
    await page.waitForTimeout(1000); // Wait for any potential dynamic content to load

    // Take screenshot after attempting XSS
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_attempt.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_attempt.png'));

    // Extract meaningful data to verify task completion
    const alertExists = await page.evaluate(() => {
      return !!document.querySelector('script');
    });

    return {
      success: true,
      action: "Attempted XSS via search input",
      extractedData: { alertExists },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
